import React from 'react';
import Form from 'react-bootstrap/Form';

export default function OpenFile() {
    return (
        <Form.Group style={{margin: 30}}>
            <Form.Label>Input file</Form.Label>
            <Form.Control type="file" />
        </Form.Group>
    )
}
